class GestureClassifier(nn.Module):
  def __init__(self):
    super(GestureClassifier, self).__init__()
    self.name = "gc"
    # input = 224 x 224 x 3
    # kernel 1: size = 5 x 5, filters = 5
    # output = 220 x 220 x 5
    self.conv1 = nn.Conv2d(3, 5, 5)

    # input = 220 x 220 x 5
    # maxpool: size = 2, stride = 2
    # output = 110 x 110 x 5
    self.pool = nn.MaxPool2d(2,2)

    # input = 110 x 110 x 5
    # kernel 2: size = 3 x 3, filters = 20
    # output = 108 x 108 x 20
    self.conv2 = nn.Conv2d(5, 20, 3)

    # max pooling 2
    # output: 54 x 54 x 20

    # fc layers
    # layer 1
    self.fc1 = nn.Linear(54 * 54 * 20, 54 * 10)

    # layer 2
    self.fc2 = nn.Linear(54 * 10, 250)

    # layer 3
    # 9 outputs
    self.fc3 = nn.Linear(250, 36)
  
  def forward(self, x):
    
    x = self.pool(F.relu(self.conv1(x)))
    x = self.pool(F.relu(self.conv2(x)))

    x = x.view(-1, 20 * 54 * 54)
    x = F.relu(self.fc1(x))
    x = F.relu(self.fc2(x))
    x = self.fc3(x)

    return x

def get_accuracy(model, loader):

  correct = 0
  total = 0
  for images, labels in loader:        
      output = model(images)
        
      #select index with maximum prediction score
      pred = output.max(1, keepdim=True)[1]
      correct += pred.eq(labels.view_as(pred)).sum().item()
      total += images.shape[0]

  return correct / total

  
